import ProfileImage from './components/profileImage';
import logoImage from '../../assets/images/logo.png';
import character1Image from '../../assets/images/character1.jpg';

function NavBar() {

  return (
    <nav className='nav-bar-container'>
        <img src={logoImage} alt="Logo" className="profile-image-container__image" />
        <ProfileImage imagePath={character1Image}/>
    </nav>
  );
}

export default NavBar;
